import React from "react";
import Video from "../../videos/videos1.mp4";
import {
  MainContainer,
  MainBackground,
  VideoBackground,
  MainContent,
  MainH1,
  MainP,
} from "./MainElements";

const MainSection = () => {
  return (
    <MainContainer>
      <MainBackground>
        <VideoBackground autoPlay loop muted src={Video} type="video/mp4" />
      </MainBackground>
      <MainContent>
        <MainH1>Text</MainH1>
        <MainP>Paragraph</MainP>
        <MainBtnWrapper>
          <button to="signup">
            Get Started{hover ? <ArrowForward /> : <ArrowRight />}
          </button>
        </MainBtnWrapper>
      </MainContent>
    </MainContainer>
  );
};

export default MainSection;
